import React from "react";
import AdminLogo from "../../../assets/img/png/adminlogo.png";
import "./MenuTop.scss";

export default function MenuTop() {
    return (
        <div className="menu_top">
            <div className="menu-top__left">
                <img className="menu-top__leftlogo" 
                    src=""
                    alt={AdminLogo}
                />
            </div>
        </div>
    )
}
